import axios from 'axios';
import { apiEndpoint } from './apiConfig';

export async function getMove(board, player) {
    const response = await axios.get(`${apiEndpoint}/getMove`, {
      headers: {
        board: board,
        player: player
      }
    });
    return response.data;
}
